package test.beast;

import beast.core.parameter.Parameter;
import beast.core.parameter.RealParameter;
import beast.evolution.alignment.Alignment;
import beast.evolution.alignment.Sequence;
import beast.evolution.tree.PathTree;
import beast.evolution.tree.Tree;
import beast.util.TreeParser;
import junit.framework.TestCase;

public class evoprotein2TestCase extends TestCase {
	
    static public Alignment getAlignment() throws Exception {
        Sequence Human = new Sequence("Human", "");
        Sequence Chimpanzee = new Sequence("Chimpanzee", "");
        Sequence Gorilla = new Sequence("Gorilla", "");
        Sequence Orangutan = new Sequence("Orangutan", "");
        Sequence Gibbon = new Sequence("Gibbon", "");

        Alignment data = new Alignment();
        data.initByName("sequence", Human, "sequence", Chimpanzee, "sequence", Gorilla, "sequence", Orangutan, "sequence", Gibbon,
                "dataType", "nucleotide"
        );
        return data;
    }

    static public Alignment getAlignmentWithNoStopCodon() throws Exception {
        Sequence Human = new Sequence("Human",           "");
        Sequence Chimpanzee = new Sequence("Chimpanzee", "");
        Sequence Gorilla = new Sequence("Gorilla",       "");
        Sequence Orangutan = new Sequence("Orangutan",   "");
        Sequence Gibbon = new Sequence("Gibbon",         "");
        
        Alignment data = new Alignment();
        data.initByName("sequence", Human, "sequence", Chimpanzee, "sequence", Gorilla, "sequence", Orangutan, "sequence", Gibbon,
                "dataType", "nucleotide"
        );
        return data;
    }
    
    static public Alignment getDummyAlignment() throws Exception {
        Sequence Human = new Sequence("Human", "CCAAAC");
        Sequence Chimpanzee = new Sequence("Chimpanzee", "CCAAAC");
        Sequence Orangutan = new Sequence("Orangutan", "CTAACC");
        Sequence Gibbon = new Sequence("Gibbon", "CTAAAC");
        Sequence Gorilla = new Sequence("Gorilla", "CTAAGC");

        Alignment data = new Alignment();
        data.initByName("sequence", Human, "sequence", Chimpanzee, "sequence", Gorilla, "sequence", Orangutan, "sequence", Gibbon,
                "dataType", "nucleotide"
        );
        return data;
    }
    
    static public Tree getTree(Alignment data) throws Exception {
        TreeParser tree = new TreeParser();
        tree.initByName("taxa", data,
                "newick", "(((Human: 0.07, Chimpanzee: 0.07): 0.43, (Orangutan: 0.4, Gibbon: 0.4): 0.1):0.0 , Gorilla: 0.5);");
        return tree;
    }
    
    static public PathTree getPathTree(Alignment data) throws Exception{
    	PathTree pathTree = new PathTree();
    	return pathTree;
    }
    
    static public RealParameter getKappa(String value) throws Exception{
    	RealParameter kappa = new RealParameter();
    	kappa.initByName("value", value);
    	return kappa;
    }
}
